Заявление президента Еврокомиссии Урсулы фон дер Ляйен:

▪️ЕС никогда не примет тезис РФ о том, что Украина не имеет права на существование, на кону ее судьба, но и судьба ЕС также;

▪️Будет активизирован механизм защиты беженцев, разрешен доступ к европейским школам, больницам и системе обеспечения;

▪️Санкции: перечислила те, что уже были приняты (заморозка активов ЦБ РФ, запрет на поставки технологий и т.д.), «но не ошибайтесь: мы заморозим и их яхты, и автомобили»;

▪️Останавливают лицензии «пропагандистской машины Кремля» - каналов Russia Today и Sputnik, а также дочерних структур;

▪️Отказ от российских энергоносителей («мы не можем полагаться на поставщика, что нам угрожает») ускорит переход на «зеленую» энергетику;

▪️Украине уже предоставили 500 млн евро военной помощи, теперь ЕС выделит еще 500 млн для помощи беженцам;

▪️Евроинтеграция Украины: «Сегодня ЕС и Украина ближе, чем когда-либо. Еще предстоит пройти долгое время, завершить войну, после - говорить о следующих шагах. Но никто не сомневается в том, что люди, которые так храбро встали на защиту своей страны, не могут оставаться вне европейской семьи».

🇺🇦 Выступление завершила, сказав по-украински «Слава Украине!»

​Харьковчане, жители нашего города!

Сегодня днём мы увидели в нашем городе диверсионные группы, военных, спецназ, которые благодаря слаженной работе ЗСУ, тер.обороне и полиции были уничтожены! Но некоторые из них прячутся в домах, подвалах, съемных квартирах и квартирах которые были оставлены при эвакуации! По нашей информации, с декабря месяца враг начал подготавливаться к захвату города и в Харьков заехали диверсионные группы мужчин в количестве по 3-5 человек, которые арендовывали квартиры и занимались диверсионной подготовкой! Сегодня ночью они опять проберутся в наш Харьков! Выявлять и пресекать их подрывную деятельность без участия гражданского населения, единения всех жителей города, очень тяжело! Для борьбы с захватчиком нам всем нужно объединиться как никогда! 

Стать монолитом, единым целым! 

Алгоритм действий:
1) в каждом доме создать группу в чатах, обсудить каждую жилую квартиру на предмет подозрительных лиц которые арендуют квартиру в количестве двух и более лиц, после чего незамедлительно сообщать в полицию, Сбу, тер.оборону, ВСУ;
2) органам государственной власти объединиться системой постоянных оповещений (мессенджеры, социальные сети, прочее) с районами, домами, улицами, ЖЕКами, уличными комитетами, чтобы своевременно доводить информацию о движущейся вражеской технике, передвигающихся противниках, фиксировать их с указанием времени и адресами перемещений;
3) сформировать среди населения (дома, подъезды, улицы, частный сектор) график гражданско-добровольного патрулирования на предмет пресечения мародёрства, выявления подозрительных лиц, поднятия общего боевого духа и настроя среди населения, подавления паники и проявлений отчаяния;
4) дееспособным мужчинам города Харькова, независимо от профессии (слесари, пекари, полицейские, судьи, прокуроры, водители, дворники, предприниматели, врачи и так далее) срочно стать на защиту своего родного города всеми доступными способами, чтобы враг понял, что он не пройдет, что нас не сломать и не победить!
4) всем жителям районов нашей области (Золочев, Волчанск, Липцы, Циркуны, Бабаи и так далее) максимально оперативно сообщать во все каналы, паблики и социальные сети точное местонахождение вражеской техники, фото, видео и точное количество единиц.

Освободим наш любимый, родной город и страну от врагов! Вместе мы непобедимы! Слава Украине!

⚠️ В Харькове начинает действовать режим военно-гражданской администрации.

  ⁃ Обстрелы продолжаются практически по всем направлениям.  ВС Украины мужественно защищают позиции. Взорван мост через Печенежскую дамбу, наши военные держат оборону. 

 - Еще тысяча жителей области вызвались защищать границы Украины, 900 – уже на боевых позициях;

  ⁃ Необходимые водители. НЕ для военной техники. Кто имеет квалификацию водителя – обращайтесь по адресам: Полтавский шлях 13/15, Шевченковский РТЦК и Новобаварский РТЦК;

  ⁃ Все стратегически и социально важные объекты обеспечены пищей и питьевой водой;

  ⁃ Область имеет запасы донорской крови и плазмы.  Но их нужно пополнять, они могут пригодиться как гражданским, так и военным.  Обращайтесь в центры крови;

 Держимся и поддерживаем нашу украинскую армию!

